import React from 'react';
import s from './Proficiency.module.css';

function Proficiency() {
    return (
        <div>
            <span>Frontend</span>
            <progress id="file" value="32" max="100"> 32% </progress>
            <span>Backend</span>
            <progress id="file" value="32" max="100"> 32% </progress>

        </div>
    );
}

export default Proficiency;
